import React from 'react';
import { Link, Element, animateScroll as scroll } from 'react-scroll';
import './App.css';

function App() {
  return (
    <div className="app-container">
      <Link className="link" to="landing" smooth={true} duration={500}>Landing</Link>
      <Link className="link" to="works" smooth={true} duration={500}>Works</Link>
      <Link className="link" to="about" smooth={true} duration={500}>About</Link>

      <Element name="landing" className="landing-container">
        <h1>Landing</h1>
      </Element>

      <Element name="works" className="works-container">
        <h1>Works</h1>
      </Element>

      <Element name="about" className="about-container">
        <h1>About</h1>
      </Element>
    </div>
  );
}

export default App;
